import { makeStyles } from '@material-ui/core/styles';

const BodyStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: '#F5F5F5',
        flexGrow: 1,
        marginTop: theme.spacing(3)
    },
    container: {
        boxShadow: '0px 2px 16px 0px rgba(0,0,0,0.08)'
    },
    header: {
        backgroundColor: '#FFFFFF',
    },
    headCell: {
        color: '#333333',
        fontFamily: 'Roboto',
        fontWeight: '500',
    },
    evenRow: {
        background: '#F5F5F5',
        border: 'none',
    },
    oddRow: {
        background: '#E9E9E9',
        border: 'none',
    },
    cell: {
        color: '#333333',
        fontFamily: 'Roboto',
        fontWeight: '400',
    },
    green: {
        color: '#31BA1F',
    },
    red: {
        color: '#C70039',
    },
    gray: {
        color: '#666666',
    },
    button: {
        alignSelf: 'Center',
    },
}));

export default BodyStyle;
